Verenigde Staten
Drama / Thriller
110 minuten

goed

met Samuel L. Jackson, Patrick Wilson en Kerry Washington

Het jonge koppel Chris en Lisa is nog maar net in hun droomhuis in Lakeview Terrace getrokken wanneer ze te maken krijgen met hun 
buurman die hun multiculturele relatie afkeurt. De man, Abel Turner, is een alleenstaande vader en agent bij de LAPD. Zijn 
patrouilletochten door de buurt geven sommigen een gevoel van veiligheid, maar Chris en Lisa nemen de voortdurende bemoeienissen 
van Turner niet. Wanneer Turner wel heel diep in hun leven binnendringt, besluit het koppel dat het tijd wordt om terug te 
vechten.
